A team of special force ops, led by a tough but fair soldier, Major &quot;Dutch&quot; Schaefer, are ordered in to assist CIA man, George Dillon, on a rescue mission for potential survivors of a Helicopter downed over remote South American jungle. Not long after they land, Dutch and his team discover that they have been sent in under false pretenses. This deception turns out to be the least of their worries though, when they find themselves being methodically hunted by something not of this world.

